function handlePerfMarks(perfData){if(!perfData.measureName){window.mdn.perf.setMark(perfData.markName)}else{window.mdn.perf.setMark(perfData.markName);window.mdn.perf.setMeasure({measureName:perfData.measureName,startMark:perfData.startMark,endMark:perfData.endMark});if(ga&&ga.create){ga('send',{hitType:'timing',timingCategory:'RUM - Interactive Examples',timingVar:perfData.measureName,timingValue:window.mdn.perf.getDuration(perfData.measureName)||0})}}}function perfMsgHandler(event){'use strict';var allowedOrigin=window.mdn.interactiveEditor.editorUrl||'https://interactive-examples.mdn.mozilla.net';var interactiveEditorInlineExperimentOrigin='https://developer.mozilla.org';var eventData=event.data;if(event.origin!==allowedOrigin&&event.origin!==interactiveEditorInlineExperimentOrigin){return false}if(eventData.markName&&eventData.markName.indexOf('interactive-editor-')>-1){handlePerfMarks(eventData)}}window.addEventListener('message',perfMsgHandler,false);